import Text from "./diplay/text";
import Location from "./diplay/location";
import Single from "./diplay/single";
import Checkbox from "./diplay/checkbox";
import Slider from "./diplay/slider";
import Rating from "./diplay/rating";

/* 根据问题渲染可视化组件, 接受一个包含问题详细信息的数组 */
export function renderEachVisualization(questions){
	const elements = [];
	questions.forEach(question => {
		switch (question.type){
			case 'text':{
				elements.push(<Text index={question.index}/>);
				break;
			}
			case 'location':{
				elements.push(<Location index={question.index}/>);
				break;
			}
			case 'single':{
				elements.push(<Single index={question.index}/>);
				break;
			}
			case 'checkbox':{
				elements.push(<Checkbox index={question.index}/>);
				break;
			}
			case 'slider':{
				elements.push(<Slider index={question.index}/>);
				break;
			}
			case 'rating':{
				elements.push(<Rating index={question.index}/>);
				break;
			}
		}
	});

	return elements;
}
